import React, { useState, useEffect, useRef } from 'react';
import axios from 'axios';
import { toast } from 'react-hot-toast';
import {
  MagnifyingGlassIcon,
  CalendarDaysIcon,
  ClockIcon,
  UserIcon,
  MapPinIcon,
  CheckCircleIcon,
  ExclamationTriangleIcon,
  XCircleIcon,
  FingerPrintIcon,
  ArrowPathIcon
} from '@heroicons/react/24/outline';

function AttendanceLogs() {
  const [logs, setLogs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [searchTerm, setSearchTerm] = useState('');
  const [dateFilter, setDateFilter] = useState('');
  const [statusFilter, setStatusFilter] = useState('');
  const [currentPage, setCurrentPage] = useState(1);
  const [totalPages, setTotalPages] = useState(1);
  const [lastUpdated, setLastUpdated] = useState(null);
  const [newlyInsertedIds, setNewlyInsertedIds] = useState([]);
  const logsPerPage = 10;
  const isRefreshingRef = useRef(false);
  const seenAnimatedIdsRef = useRef(new Set());

  const getRowId = (log) => {
    return (
      log?.ATTENDANCEID ??
      (log?.STUDENTID && log?.SCANDATETIME ? `${log.STUDENTID}-${log.SCANDATETIME}` : undefined)
    );
  };

  useEffect(() => {
    fetchAttendanceLogs();
  }, [currentPage, searchTerm, dateFilter, statusFilter]);

  // Auto-refresh every 5 seconds to show new attendance records
  // Recreate interval when filters/pagination change so it uses fresh params
  useEffect(() => {
    const interval = setInterval(() => {
      if (!isRefreshingRef.current) {
        fetchAttendanceLogsSilently();
      }
    }, 5000);

    return () => clearInterval(interval);
  }, [currentPage, searchTerm, dateFilter, statusFilter]);

  const fetchAttendanceLogs = async () => {
    try {
      setLoading(true);
      const params = new URLSearchParams({
        page: currentPage,
        limit: logsPerPage,
        ...(searchTerm && { search: searchTerm }),
        ...(dateFilter && { date: dateFilter }),
        ...(statusFilter && { status: statusFilter })
      });

      const response = await axios.get(`http://localhost:5000/api/logs/attendance?${params}`, {
        headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
      });

      setLogs(response.data.logs || []);
      setTotalPages(Math.ceil((response.data.total || 0) / logsPerPage));
      setLastUpdated(new Date());
    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`3060998697_73_6_73_61_11`,'Error fetching attendance logs:', error));
      toast.error('Failed to load attendance logs');
      setLogs([]);
    } finally {
      setLoading(false);
    }
  };

  const fetchAttendanceLogsSilently = async () => {
    try {
      if (isRefreshingRef.current) return;
      isRefreshingRef.current = true;

      const params = new URLSearchParams({
        page: currentPage,
        limit: logsPerPage,
        ...(searchTerm && { search: searchTerm }),
        ...(dateFilter && { date: dateFilter }),
        ...(statusFilter && { status: statusFilter })
      });

